#Define a class for the graph network that takes in a number of vertices
class Graph():
  def __init__(self,vertexnr):
    #Make arrays for the graph, the OD pairs associated with the network,
    # A matrix to store the cost function in and a list of vertices
    self.graph = []
    self.ODPairs = []
    self.costMatrix = []
    self.V = [i for i in range(0,vertexnr)]
    self.graph = [[0 for i in range(0,len(self.V))] for j in range(0,len(self.V))]
    self.costMatrix = [[lambda x: 0 for i in range(0,len(self.V))] for j in range(0,len(self.V))]
    
    #Create a function to add an edge.
    #INPUT: - i,j: Ordered pair to mark the vertices between which the edge runs.
    #       - costFN: A lambda function that provides a cost to the new edge.
    #OUTPUT: None

  def addEdge(self,i,j,costFn):
    #If the given vertices are part of the graph, put the cost function
    #in the correct spot in the cost matrix and put a 1 in the adjacency matrix.
    if i in self.V and j in self.V:
      self.costMatrix[i][j] = costFn
      self.graph[i][j] = 1
      return
  
  #Create a function to add an OD pair to the network
  #INPUT: - i,j: Ordered pair to give the starting and ending vertex
  #OUTPUT: None

  def addODPair(self,i,j):
    #Add the OD Pair to the OD array if the vertices are in the graph.
    if i in self.V and j in self.V:
      ODArr = [i,j]
      self.ODPairs.append(ODArr)

  #Create a function to find all paths between two vertices.
  #INPUT: - start: Vertex we want to start from
  #       - end: Vertex to end on
  #       - curpath: List to store the current path we are working on
  #       - visited: List to store the visited vertices
  #OUTPUT: Prints a list of all paths between start and end
  def pathfind(self,start,end, maxLen = 0, curpath=[],visited=[]):
    #Check if the starting and ending vertex are in the graph
    if start in self.V and end in self.V:
        #Add starting vertex to visited and current path
        visited.append(start)
        curpath.append(start)

        #If we reach the end, print the full path
        if start==end:
          if len(curpath) <= maxLen or  maxLen == 0:
            print(f"{curpath}, Vertex Pair: {(curpath[0],curpath[-1])}")

        else:
          #If not, loop over all vertices, and check if they are viable
          for i in range(0,len(self.V)):
            if(i not in visited and self.graph[start][i] == 1):
              #If so, use recursion on the same graph, with a new starting vertex
              self.pathfind(i,end,maxLen, curpath,visited)
        #If we did all these vertices (or reach the end), remove the last entry
        #of the current path and the visited array to "go up a layer"
        curpath.pop()
        visited.pop()
        return
    else:
      print(f"Error, vertex {start} or vertex {end} are not in the graph.")

#Create a function to make the graph that contains marginal costs instead of the
#normal cost functions.
#
#INPUT: G: Graph we wish to make a copy of
#OUTPUT: MG: Copy of G with marginal cost functions
def MarginalGraph(G):
  #Make a copy of the original graph
  MG = copy.deepcopy(G)
  #For all edges, differentiate the cost function and put it as the corresponding
  #marginal cost in the cost matrix of MG
  for i in range(len(MG.graph)):
    for j in range(len(MG.graph)):
      t = sym.symbols("t")
      eq = lambda x: G.costMatrix[i][j](t)
      MG.costMatrix[i][j] = sym.lambdify(t,sym.diff(t*eq(t),t))
  return MG

def makeGraphSymmetric(G):
  G2 = copy.deepcopy(G)
  for i in range(0,len(G2.V)):
    for j in range(0,len(G2.V)):
        G2.graph[j][i] = G2.graph[i][j]
        G2.costMatrix[j][i] = G2.costMatrix[i][j]
  return G2

"""Functions for performing the algorithm. The bisection method is used for the line search step."""

#Function that implements the bisection method to find the root of a given function.
#INPUT: - f: Function to find the root of. It is assumed the function maps real numbers
#             to real numbers, and not vectors to real numbers.
#       - a,b: Beginning and end points of the interval to find a root over
#       - eps: Tolerance to end iterations, based on the criterion that |f(c)|<eps
#               as decribed in the article.
#
#OUTPUT: - mid: x coordinate of the root of the function f
def bisection(f,a,b, eps):
  funA = f(a)
  funB = f(b)
  if(funA*funB <= 0):
    mid = (a+b)/2
    funMid = f(mid)
    if abs(funMid) < eps:
      return mid
    else:
      if(funA*funMid < 0):
        return bisection(f,a,mid,eps)
      else:
        return bisection(f,mid,b,eps)
  else:
    print(f"cannot guarantee root, terminating bisection method.")
    return



#A function find the cheapest path between two vertices, based on no extra flow
#INPUT: - graph: The graph structure we are working with
#       - paths: List of all paths between the desired OD pair
#
#OUTPUT: - bestIndex: Index of the best possible path to take
#        - bestPath: The best path to take from the given list of paths
def AONinitial(graph,paths):
  #Set the best cost to infinity
  best = np.inf
  #If there is only one path, return this path
  if len(paths) == 1:
    return 0,paths[0]
  
  #For each path set the new cost to zero
  for i in range(0, len(paths)):
    newCost = 0
    #Add the cost at zero traffic of each edge to the newcost
    for s in range(0,len(paths[i])-1):
       newCost += graph.costMatrix[paths[i][s]][paths[i][s+1]](0)

    #If the new cost is lower than the previous best found, set the current to the 
    #best value
    if (newCost< best):
      bestPath = paths[i]
      bestIndex = i
      best = newCost
  return bestIndex,bestPath

#Function to find the initial flow based on the zero-flow all or nothing
# assignment.
#INPUT: - graph: The graph structure we are working with
#       - paths: List of all paths between all OD-pairs.
#       - rate: List that contains all the rates for all OD-pairs.
# Note that both the paths and rates should be in the same order as the OD pairs!
#
#OUTPUT: - x: Initial flow x(0) to be used as an initial feasible flow.
def initialSetup(graph,paths,rate):
  #Make a new matrix to store all the edge flows in
  N = len(graph.graph)
  x = np.zeros((N,N))

  #For all OD-pairs, perform the zero flow all or nothing assignment
  for j in range(0,len(graph.ODPairs)):
    indexOfPath, bestpath = AONinitial(graph,paths[j])
    for i in range(len(bestpath)-1):
      #For each edge in the found best path, add the rate of the current OD-pair
      # to the flow matrix.
      x[bestpath[i]][bestpath[i+1]] += rate[j]
  return x

#Function to update the cost matrix 
#INPUT: - graph: The graph structure we are working with
#       - x: Current flow vector
#
#OUTPUT: - newCostMatrix: matrix that stores the cost of each edge for a given
#         edge flow.
def updateCostMatrix(graph,x):
  #Make an array to store the costs in
  N = len(graph.graph)
  newCostMatrix = np.zeros((N,N))
  #For each edge, check if the entry in the cost matrix is a function, and 
  # if so, add the cost of the flow on that edge to the new cost matrix value.
  for i in range(N):
    for j in range(N):
      if isfunction(graph.costMatrix[i][j]):
        newCostMatrix[i][j] += graph.costMatrix[i][j](x[i][j])
  return newCostMatrix

#Function to perform the all or nothing step for the algorithm.
#INPUT: - graph: The graph structure we are working with
#       - paths: List of all paths between all OD-pairs.
#       - costMatrix: the current costs to base the all or nothing assignment on
#       - rate: List that contains all the rates for all OD-pairs.
#
#OUTPUT: -y: matrix that corresponds to the edge flow for the all or nothing
#           flow.
def AONUpdate(graph,paths,costMatrix,rate):
  #Make a matrix to store the flows in
  y = np.zeros_like(costMatrix)

  #For all OD pairs, store the number of paths, and make a vector
  #to store the cost of the flow on each path.
  for n in range(0,len(graph.ODPairs)):
    pathNr = len(paths[n])
    pathFlowCosts = np.zeros(pathNr)

    #For all paths, add the cost of the path, corresponding to the edge
    # flows provided
    for i in range(0,pathNr):
      for j in range(0,len(paths[n][i])-1):
        pathFlowCosts[i] += costMatrix[paths[n][i][j]][paths[n][i][j+1]]
    
    #Find the best possible path out of these path flows
      bestPathIndex = np.where(pathFlowCosts == min(pathFlowCosts))[0][0]
      bestPath = paths[n][bestPathIndex]

    #Add the full rate associated with the current OD pair to all
    # of the edges in this path
    for i in range(len(bestPath)-1):
        y[bestPath[i]][bestPath[i+1]] += rate[n]
    
  return y


#Function to perform the Frank-Wolfe algorithm for a given instance of a routing
# game. Algorithm finds a UE edge flow for the instance.
#INPUT:- graph: The graph structure we are working with
#       - P: List of all paths between all OD-pairs.
#       - r: List that contains all the rates for all OD-pairs.
#
#OPTIONAL INPUTS:
# - maxIt: Maximum number of iterations to perform before terminating
#                           standard set to 1e5 iterations
# - LSTol: The tolerance to use for the bisection method, standard 1e-6
# - itTol: The tolerance to use for the iterations of the FW-algorithm, tests
# the consecutive increase/decrease. That is, the iteration terminates if
# max(abs(x(n)-x(n+1)) < itTol. Standard set to 1e-3.

def FrankWolfe(graph,P,r,x0=None,errorList=np.array([]),maxIt=500,LSTol=1e-8,itTol=1e-8):
  #Make an array to store the approximate error values in
  print(f"Starting iterations with tolerance {LSTol} for the line search\
  and tolerance {itTol} for the error tolerance.\n")
  
  #Set the iteration counter to 1 and compute the initial flow matrix.
  if x0 is None:
      n = 1
      x_n = initialSetup(graph,P,r)
  else:
      n=1
      x_n = x0
  err = np.max(x_n)
  print(err)
  #While True, 
  while 0<1:
    #Perform the update for the cost matrix and based on this new cost,
    # find a feasible direction using all or nothing assignment.
    t_n = updateCostMatrix(graph,x_n)
    s_n = AONUpdate(graph,P,t_n,r)
    
    # #Define the function to perform the line search on, as described in the paper.
    # lineSearchFn = lambda a:  sum([sum([graph.costMatrix[i][j](x_n[i][j] + a*(s_n[i][j]-x_n[i][j]))*(s_n[i][j]-x_n[i][j]) for j in range(0,len(graph.V))]) for i in range(0,len(graph.V))])
    
    # #Try to find the step size using the bisection method. If this fails, use a
    # # static step size.
    # alpha = bisection(lineSearchFn,0,1,LSTol)
    # if alpha == None:
    #   if lineSearchFn(1)>0:
    #     alpha = 0
    #   else:
    #     alpha = 1
    #Define the function to perform the line search on, as described in the paper.
    lineSearchFn = lambda a:  sum([sum([graph.costMatrix[i][j](x_n[i][j] + a*(s_n[i][j]-x_n[i][j]))*(s_n[i][j]-x_n[i][j]) for j in range(0,len(graph.V))]) for i in range(0,len(graph.V))])
    
    # if n == 1:
    #     alpha = bisection(lineSearchFn,0,1,LSTol)
    #     if alpha == None:
    #       if lineSearchFn(1)>0:
    #         alpha = 0
    #       else:
    # #         alpha = 1
    # else:
    alpha = 2/(n+3)
    
    #Compute the new flow as a convex combination of the current flow and the feasible
    # direction.
    x_new = x_n + alpha * (s_n - x_n)
    if n == 1:
        print(np.max(x_new))
    #Compute the "error" (that is the maximal difference between iterations)
    # and put this in the error array.
    err= np.max(np.abs(x_new-x_n))
    errorList = np.append(errorList,err)
  
    #If this is less than the tolerance, we are done.
    if err< itTol:
      print(f"Sucessfully found an equilibrium flow at iteration: {n}: \nApproximate error: {err}, terminating.")
      return x_new,errorList

    #Else, print the error and iteration number and reset x_n, increase iteration count.
    if alpha < 0.01:
      print("hi")
      # print(f"Iteration: {n}: \nApproximate error: {err} \n")
      # print(maxIt)
      return FrankWolfe(graph,P,r, errorList=errorList, x0=x_new, maxIt=maxIt-n)
      
    x_n = x_new
    n+= 1
    

    #Check if we ran over the maximum number of iterations. If so, terminate.
    if n > maxIt:
      print(f"Exceeded maximum iteration count. Terminating with final error {err}.")
      return x_new,  errorList


#Function to print all the edge flows
#INPUT: - flow: The flow to print
#OUTPUT: - print the flow on all edges
def parseFlow(flow, marginal):
  for i in range(len(flow)):
    for j in range(len(flow)):
      if flow[i][j] != 0:
        if marginal:
          print(f"The marginal flow on edge ({i},{j}) is equal to {flow[i][j]}")
        else:
          print(f"The flow on edge ({i},{j}) is equal to {flow[i][j]}")


#Function to compute the cost of a flow, using the edge cost sum outlined in the
#paper.
#INPUTS: - flow: The flow to compute the cost of.
#         - graph: The graph structure used in computing the flow.
#
#OUTPUT: sum: The total cost of the flow.
def computeCost(flow,graph):
  sum = 0
  n = len(G.graph);
  for i in range(n):
    for j in range(n):
      sum += graph.costMatrix[i][j](flow[i][j])*flow[i][j]
  return sum


#Function to create a plot of the error
def errorPlot(arr, marginal):
  x = np.linspace(1,len(arr),len(arr))
  plt.figure(figsize=(10,7.5))
  p1  = plt.semilogy(x,1/x, label = "$f(x) = 1/x$",zorder=1)
  p2 = plt.semilogy(x,arr, label = "Approximate error",zorder=2)
  if marginal:
    plt.title("Error progression of marginal iteration")
  else:
    plt.title("Error progression of normal iteration")
  plt.ylabel("Error")
  plt.xlabel("Iteration number")
  plt.legend()
  plt.show()

def POAcalc(G,P,r):
  f,_ = FrankWolfe(G,P,r)
  MG = MarginalGraph(G)
  mf,_ = FrankWolfe(MG,P,r)
  POA = computeCost(f,G)/computeCost(mf,G)
  return POA


def fullRun(G,P,r,tol,lineTol = 1e-8):
  f,errF = FrankWolfe(G,P,r,LSTol = lineTol,itTol = tol)
  MG = MarginalGraph(G)
  mf, errMf = FrankWolfe(MG,P,r, LSTol = lineTol,itTol = tol)


  print(f"\n=====================\n")
  print(f"For the given network the following flow is a user equilibrium:")
  parseFlow(f,False)
  print(f"\n=====================\n")
  print(f"For the given network the following flow is a system optimum:")
  parseFlow(mf,True)
  print(f"\n=====================\n")
  print(f"The difference between these UE flow and optimal flow is as follows:")
  parseFlow((f-mf),False)
  print(f"\n=====================\n")
  errorPlot(errF,False)
  errorPlot(errMf,True)
  Cf = computeCost(f,G)
  Cmf = computeCost(mf,G)

  POA = Cf/Cmf
  print(f"The cost of the UE flow is {Cf}, while the cost of the system optimum flow is {Cmf}.\
  The price of anarchy is therefore {POA}")

